// src/components/admin/AdminsAdmin.js
import React, { useState, useEffect } from 'react';
import styles from '../../styles/admin.module.css';
import AdminForm from './AdminForm';

const AdminsAdmin = () => {
  const [admins, setAdmins] = useState([]);
  const [editingAdmin, setEditingAdmin] = useState(null);

  useEffect(() => {
    fetch('/api/admins')
      .then(response => response.json())
      .then(data => setAdmins(data))
      .catch(error => console.error('Error fetching admins:', error));
  }, []);

  const handleAddAdmin = (admin) => {
    setAdmins([...admins, admin]);
  };

  const handleUpdateAdmin = (updatedAdmin) => {
    setAdmins(admins.map(admin => (admin.id === updatedAdmin.id ? updatedAdmin : admin)));
    setEditingAdmin(null);
  };

  const handleDeleteAdmin = (adminId) => {
    setAdmins(admins.filter(admin => admin.id !== adminId));
  };

  return (
    <div className={`${styles.adminContainer} container`}>
      <h2>Manage Admins</h2>
      <AdminForm
        onAdd={handleAddAdmin}
        onUpdate={handleUpdateAdmin}
        editingAdmin={editingAdmin}
      />
      <table className={styles.table}>
        <thead>
          <tr>
            <th className={styles.th}>ID</th>
            <th className={styles.th}>Name</th>
            <th className={styles.th}>Email</th>
            <th className={styles.th}>Actions</th>
          </tr>
        </thead>
        <tbody>
          {admins.map(admin => (
            <tr key={admin.id}>
              <td className={styles.td}>{admin.id}</td>
              <td className={styles.td}>{admin.name}</td>
              <td className={styles.td}>{admin.email}</td>
              <td className={styles.td}>
                <button
                  onClick={() => setEditingAdmin(admin)}
                  className={styles.button}
                >
                  Edit
                </button>
                <button
                  onClick={() => handleDeleteAdmin(admin.id)}
                  className={styles.button}
                >
                  Delete
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default AdminsAdmin;
